package main

import (
	"bytes"
	"fmt"
	"testing"
)

func TestMine(t *testing.T) {
	cases := []struct {
		input    string
		expected string
	}{
		{TEST, "000021a21c0031d235c37f1665adf36c3ed90084a438d3972004978b67846115"},
	}

	for _, tc := range cases {
		b := bytes.NewBufferString(tc.input)
		actual := Mine(b.Bytes())

		if tc.expected == "" && actual != nil {
			t.Errorf("expected nil - got %x", actual)
			return
		}

		actualStr := fmt.Sprintf("%x", actual)
		if tc.expected != actualStr {
			if actual == nil {
				actualStr = "NIL"
			}

			t.Errorf("expected hash %s - got %s", tc.expected, actualStr)
			return
		}
	}
}

